import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="container">
      <div className="row">
          <div className="col-md-3"><p>Column 1</p></div>
          <div className="col-md-3"><p>Column 2</p></div>
          <div className="col-md-3"><p>Column 3</p></div>
          <div className="col-md-3"><p>Column 4</p></div>
      </div>
    </div>
  );
}

export default App;
